class AdConfig {  bool? isAdStatus;  bool? isUrlRedirectStatus;  bool? isInterAdStatus;  bool? isOpenAdStatus;  String? redirectUrl;  String? interShowType;  String? interInitialShowType;  String? native;  String? inter;  String? banner;  String? open;  String? versionCode;  AdConfig({    this.isAdStatus,    this.isUrlRedirectStatus,    this.isInterAdStatus,    this.redirectUrl,    this.interShowType,    this.interInitialShowType,    this.native,    this.inter,    this.banner,    this.open});  AdConfig.fromJson(Map<String, dynamic> json) {    isAdStatus = json['isAdStatus'];    isUrlRedirectStatus = json['isUrlRedirectStatus'];    isInterAdStatus = json['isInterAdStatus'];    isOpenAdStatus = json['isOpenAdStatus'];    redirectUrl = json['redirectUrl'];    interShowType = json['interShowType'];    interInitialShowType = json['interInitialShowType'];    native = json['native'];    inter = json['inter'];    banner = json['banner'];    open = json['open'];    versionCode = json['versionCode'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['isAdStatus'] = isAdStatus;    data['isUrlRedirectStatus'] = isUrlRedirectStatus;    data['isInterAdStatus'] = isInterAdStatus;    data['isOpenAdStatus'] = isOpenAdStatus;    data['redirectUrl'] = redirectUrl;    data['interShowType'] = interShowType;    data['interInitialShowType'] = interInitialShowType;    data['native'] = native;    data['inter'] = inter;    data['banner'] = banner;    data['open'] = open;    data['versionCode'] = versionCode;    return data;  }}